import React, { useState } from "react";
import { NavigationContainer } from "@react-navigation/native";
import { AppLoading } from "expo";

import { createStackNavigator } from '@react-navigation/stack';
import { createDrawerNavigator } from '@react-navigation/drawer';
import navigationTheme from "./app/navigation/navigationTheme";
import AppNavigator from "./app/navigation/AppNavigator";
import OfflineNotice from "./app/components/OfflineNotice";
import AuthNavigator from "./app/navigation/AuthNavigator";
import AuthContext from "./app/auth/context";
import authStorage from "./app/auth/storage";
import AcceuilAD from "./app/screens/Administrator/AcceuilAD";
import { navigationRef } from "./app/navigation/rootNavigation";
import TrainersList from './app/screens/Administrator/TrainerList';
import ParentsList from './app/screens/Administrator/Parents';
import SPManagers from './app/screens/Administrator/SPManagers';
import AdminList from './app/screens/Administrator/Admins';
import Updat_Ent from "./app/screens/Administrator/Updat_Ent";
import Update_ad from "./app/screens/Administrator/Update_ad";
import Update_par from "./app/screens/Administrator/Update_par";
import UpdateDS from "./app/screens/SportManager/Example1";
import Planning from "./app/screens/SportManager/Specialite";
import Add_Planning from "./app/screens/SportManager/Example1";
import specialite from "./app/screens/SportManager/Specialite";
import ListingEditScreen from "./app/screens/ListingEditScreen";
import SpecialiteList from "./app/screens/Administrator/Specialite1";

const Stack = createStackNavigator();
const Drawer = createDrawerNavigator();

  function Trainer() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Trainers List" component={TrainersList} />
      <Stack.Screen name="Update" component={Updat_Ent} />


    </Stack.Navigator>

  );
} 
function SPmanager() {

  return (
    <Stack.Navigator>      
      <Stack.Screen name="SPManagers" component={SPManagers} />    
      <Stack.Screen name="Update_DS" component={UpdateDS}/> 
    </Stack.Navigator>
  );
} 
function Admin() {
  return (
    <Stack.Navigator>

      <Stack.Screen name="Admins List" component={AdminList} />
      <Stack.Screen name="Update_ad" component={Update_ad} />
    </Stack.Navigator>
  );
} 
function Parents() {
  return (
    <Stack.Navigator>

      <Stack.Screen name="Parents List" component={ParentsList} />
      <Stack.Screen name="Update_par" component={Update_par} />

    </Stack.Navigator>
  );
}   
export default function App() {
  return (

    <NavigationContainer>
    <Drawer.Navigator>
      <Drawer.Screen name="Acceuil" component={AcceuilAD} />
      <Drawer.Screen name="Trainers" component={Trainer} />
       <Drawer.Screen name="Admins" component={Admin} />
      <Drawer.Screen name="Parents" component={Parents} />
      <Drawer.Screen name="Directeur Sportifs" component={SPmanager} /> 

    </Drawer.Navigator>
  </NavigationContainer> 



   );




}
